function addZero(tmp) {
  if(tmp >= 10)
    return tmp;
  return '0' + tmp;
}

function dateStr(date) {
  let date_str = "";
  date_str += date.getFullYear() + '-' + addZero((date.getMonth()+1)) + '-' + addZero(date.getDate()) + ' ' + addZero(date.getHours()) + ':' + addZero(date.getMinutes()) + ':' + addZero(date.getSeconds());
  return date_str;
}

